import { useState } from 'react'
let Contact = ()=>{
    
    let arr = ["red", "green", "blue", "yellow", "pink", "black"];
    
    return(
        <>
            <div className="container" style={{minHeight : "650px"}}>
                <table className='table table-dark my-4'>
                    <thead>
                        <tr>
                            <th>S.No.</th>
                            <th>Color Name</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            arr.map((x, n)=>{
                                return(
                                    <>
                                        <tr>
                                            <td>{n+1}</td>
                                            <td>{x}</td>
                                        </tr>
                                    </>
                                )
                            })
                        }
                    </tbody>
                </table>
            </div>
        </>
    )


}

export default Contact;
